import React from "react";

const About = () => {
  return (
    <div className="popup">
      <h1>Hi Im Blank, and welcome again to my portfolio</h1>
      <h1 className="popuptext">
        This is my final Portfolio, the culmination of all of my projects in
        Brown CSCI1300: User Interface and User Experience. This page shows the
        developlemnt of my front-end skills. From utilizing hierarchy, to
        emphasising learnability and usuablity. This page features projects that
        utilize HTML, CSS, design skills, and even CSS. Hope you enjoy and learn
        something along the way!
      </h1>
      <br></br>
      <h1>Here's a brief overview of the four projects in this portfolio:</h1>

      <h1 className="popuptext">The first portfolio is</h1>
    </div>
  );
};

export default About;
